(1, 'هانى درويش', 'هانى-درويش', 'hany.freestyle4u@gmail.com', NULL, NULL, NULL, '[\"admin\"]', 1, NULL, '$2y$10$IEGrGzFtf0Pnjdj.fddUd.zy7kI9iWHZE8lDrR9atlHOMDDBdppfW', NULL, NULL, '2024-08-12 06:21:46', '2024-08-12 06:21:46', NULL),
(2, 'Aya Sanad', 'Aya-Sanad', 'aya.sanad@ardillanet.com', NULL, NULL, NULL, '[\"editor\"]', 1, NULL, '$2y$10$hPpyiBO/uRea8cF678MTheAs8PmXC.jzZTeMbdihpgMPtvDC9H0Lq', 'مرحبًا بكم في عالمي، حيث الكلمات ترشدكم إلى فهم أعماق أحلامكم. أنا Aya Sanad، المتخصص في تفسير الأحلام وكتابة المقالات المعلوماتية التي تضيء الجوانب المخفية وراء رموز وقصص أحلامنا.\nبخلفية أكاديمية في علم النفس وعلم الاجتماع، أعمق في الأبعاد النفسية والثقافية التي تشكل عوالم أحلامنا. أسعى من خلال كتاباتي لتقديم تحليلات دقيقة ومفهومة، تساعد القراء على ربط تجاربهم الحلمية بواقع حياتهم.\nمن خلال مقالاتي، ستجدون دليلًا شاملًا لفهم الرسائل الخفية في الأحلام وكيفية تطبيق هذه الفهوم في تعزيز النمو الشخصي والوعي الذاتي. انضموا إلي في هذه الرحلة الاستكشافية لعالم الأحلام، حيث كل حلم هو بوابة لاكتشاف الذات.', NULL, '2024-08-12 06:21:46', '2024-08-12 06:21:46', NULL),
